                <img src={props.flag} alt={props.name} className="rounded-t-lg" />
            
            <div>
            <p> Name:{props.name} </p>
            <p> Continents:{props.continents} </p>
            <Link to={`/countries/${props.id}`}>
                <button className={style.btnD}> Details </button>
            </Link>   
            </div>
                      
            
        </div>
    )
}

export default Card;
